  "userdoc": {
    "methods": {
      "getNumDecimalsByIndex(uint256)": {
        "notice": "Given the index for a token in the registry, returns the number of decimals as provided in the associated TokensAttribute struct.     * Example:  getNumDecimalsByIndex(1);  => 18"
      },
      "getNumDecimalsFromSymbol(string)": {
        "notice": "Given the symbol for a token, returns the number of decimals as provided in the associated TokensAttribute struct.     * Example:  getNumDecimalsFromSymbol(\"REP\");  => 18"
      },
      "getTokenAddressByIndex(uint256)": {
        "notice": "Given the known index of a token within the registry's symbol list, returns the address of the token mapped to the symbol at that index.     * This is a useful utility for compactly encoding the address of a token into a TermsContractParameters string -- by encoding a token by its index in a a 256 slot array, we can represent a token by a 1 byte uint instead of a 20 byte address."
      },
      "getTokenAddressBySymbol(string)": {
        "notice": "Given a symbol, resolves the current address of the token the symbol is mapped to."
      },
      "getTokenAttributesByIndex(uint256)": {
        "notice": "Given the index for a token in the registry, returns a tuple containing the token's address, the token's symbol, the token's name, and the number of decimals.     * Example:  getTokenAttributesByIndex(1);  => [\"0xc02aaa39b223fe8d0a0e5c4f27ead9083c756cc2\", \"WETH\", \"Canonical Wrapped Ether\", 18]"
      },
      "getTokenAttributesBySymbol(string)": {
        "notice": "Given the symbol for a token in the registry, returns a tuple containing the token's address, the token's index in the registry, the token's name, and the number of decimals.     * Example:  getTokenAttributesBySymbol(\"WETH\");  => [\"0xc02aaa39b223fe8d0a0e5c4f27ead9083c756cc2\", 1, \"Canonical Wrapped Ether\", 18]"
      },
      "getTokenIndexBySymbol(string)": {
        "notice": "Given a symbol, resolves the index of the token the symbol is mapped to within the registry's symbol list."
      },
      "getTokenNameByIndex(uint256)": {
        "notice": "Given the index for a token in the registry, returns the name of the token as provided in the associated TokensAttribute struct.     * Example:  getTokenNameByIndex(1);  => \"Canonical Wrapped Ether\""
      },
      "getTokenNameBySymbol(string)": {
        "notice": "Given a symbol, returns the name of the token the symbol is mapped to within the registry's symbol list."
      },
      "getTokenSymbolByIndex(uint256)": {
        "notice": "Given an index, resolves the symbol of the token at that index in the registry's token symbol list."
      },
      "setTokenAttributes(string,address,string,uint8)": {
        "notice": "Maps the given symbol to the given token attributes."
      }
    }
  }
